@prefix : <http://lod.csd.auth.gr/atm/atm.ttl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .

:ATM a owl:Class .
:Account a owl:Class .
:Bank a owl:Class .
:CashCard a owl:Class .
:Customer a owl:Class .

:ownsCard a owl:ObjectProperty ;
    rdfs:domain :Customer ;
    rdfs:range :CashCard .

:belongsToBank a owl:ObjectProperty ;
    rdfs:domain :ATM ;
    rdfs:range :Bank .

:hasAccount a owl:ObjectProperty ;
    rdfs:domain :Customer ;
    rdfs:range :Account .

:cardIssuedBy a owl:ObjectProperty ;
    rdfs:domain :CashCard ;
    rdfs:range :Bank .

:ATM rdfs:subClassOf [
    a owl:Restriction ;
    owl:onProperty :belongsToBank ;
    owl:someValuesFrom :Bank
] .

:Customer rdfs:subClassOf [
    a owl:Restriction ;
    owl:onProperty :ownsCard ;
    owl:someValuesFrom :CashCard
] .

:CashCard rdfs:subClassOf [
    a owl:Restriction ;
    owl:onProperty :cardIssuedBy ;
    owl:someValuesFrom :Bank
] .
